import { Container, Typography, Button, Paper } from '@mui/material';
import { useAuth } from '../context/AuthContext';

const Dashboard = () => {
  const { logout } = useAuth();

  return (
    <Container component="main" maxWidth="md" style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <Paper elevation={6} style={{ padding: '40px', textAlign: 'center' }}>
        <Typography variant="h3" component="h1" gutterBottom>
          Welcome to the Dashboard
        </Typography>
        <Button 
          variant="contained" 
          color="primary" 
          onClick={logout} 
          style={{ marginTop: '20px' }}
        >
          Logout
        </Button>
      </Paper>
    </Container>
  );
};

export default Dashboard;
